import React, { useState } from "react";
import { RouteComponentProps, useLocation } from "react-router";
import profilePic from "./images/profile/2602017071517530029820170521192154199Screenshot_2016-05-29-20-10-52_1.jpg";
import MoreVertIcon from "@material-ui/icons/MoreVert";

import SuperstarzIconLight from "./images/ssmall.png";
import SuperstarzIconDark from "./images/sdsmall.png";
import {
  useTheme,
  Paper,
  useMediaQuery,
  Grid,
  Typography,
  makeStyles,
  createMuiTheme,
  MuiThemeProvider,
} from "@material-ui/core";

interface stateType {
  userdata: { username: string; usercolor: string; userimage: string };
}

function Supercheck() {
  const [darkmode, setDarkmode] = useState<boolean>(false);
  interface IappVariables {
    shade: string;
    shade2: string;
    shade2num: string;
    shade2nump: string;
    logoimage: string;
    secondarymaincolor: string;
    maincolor: string;
    shade2nump22: string;
  }

  var appVariables: IappVariables = {
    shade: "",
    shade2: "",
    shade2num: "",
    shade2nump: "",
    logoimage: "",
    secondarymaincolor: "",
    maincolor: "",
    shade2nump22: "",
  };

  var appVariablesDARK: IappVariables = {
    shade: "#cccccc",
    shade2: "#cccccc",
    shade2num: "1.1",
    shade2nump: "1.8",
    logoimage: SuperstarzIconDark,
    secondarymaincolor: "#ccccccff",
    maincolor: "#ccccccff",
    shade2nump22: "5.5",
  };

  var appVariablesLIGHT: IappVariables = {
    shade: "#0b111b",
    shade2: "#0b111b",
    shade2num: "1.5",
    shade2nump: "1.5",
    logoimage: SuperstarzIconLight,
    secondarymaincolor: "#0b111b",
    maincolor: "#0b111b",
    shade2nump22: "8",
  };

  if (darkmode) {
    appVariables = appVariablesDARK;
  } else {
    appVariables = appVariablesLIGHT;
  }

  let themeGeneralSettings = createMuiTheme({
    palette: {
      primary: {
        main: `${appVariables.maincolor}`,
      },
      secondary: {
        main: `${appVariables.secondarymaincolor}`,
      },
      type: darkmode ? "dark" : "light",
    },
  });

  var useStyle = makeStyles((themeGeneralSettings) => ({
    optionsContainer: {
      [themeGeneralSettings.breakpoints.up("xs")]: {
        padding: "3vh",
        top: "1em",
        fontWeight: "bold",
        display: "flex",
        alignItems: "center",
      },
      [themeGeneralSettings.breakpoints.up("sm")]: {
        padding: "4.5vh",
        top: "1em",
        fontWeight: "bold",
        display: "flex",
        alignItems: "center",
      },
    },

    superstarzText: {
      [themeGeneralSettings.breakpoints.up("xs")]: {
        fontFamily: "kaushan_scriptregular",
        fontSize: "2.9vh",
        fontWeight: "bolder",
        transition: "opacity 1.5s",
      },
      [themeGeneralSettings.breakpoints.up("sm")]: {
        fontFamily: "kaushan_scriptregular",
        fontSize: "3.3vw",
        fontWeight: "bolder",
        transition: "opacity 1.5s",
      },
      [themeGeneralSettings.breakpoints.up("md")]: {
        fontFamily: "kaushan_scriptregular",
        fontSize: "2.4vw",
        fontWeight: "bolder",
        transition: "opacity 1.5s",
      },
    },
  }));

  var classes = useStyle();

  const { state } = useLocation<stateType>();
  console.log(state.userdata);
  return (
    <MuiThemeProvider theme={themeGeneralSettings}>
      <Paper>
        <Grid
          xs={12}
          container
          style={{
            padding: "5px",
            paddingLeft: "11px",
            position: "absolute",
            top: "0em",
            fontFamily: "kaushan_scriptregular",
            transition: "opacity 1.5s",
            display: "flex",
          }}
        >
          <Grid
            xs={12}
            item
            style={{
              fontFamily: "kaushan_scriptregular",
              fontSize: "2.41vw",
              fontWeight: "bolder",
              display: "flex",
              alignItems: "center",
              justifyContent: "flex-start",
            }}
          >
            <img
              style={{
                objectFit: "contain",
                width: "4.8%",
                paddingRight: "200px",
              }}
              src={SuperstarzIconLight}
              alt="SuperstarZ logo"
            />
            <Typography className={classes.superstarzText}>
              <p
                className={
                  darkmode
                    ? "text-superstarz-dark   text-align-left"
                    : "text-superstarz-light   text-align-left"
                }
              >
                SuperstarZ
              </p>
            </Typography>
          </Grid>
        </Grid>
      </Paper>
    </MuiThemeProvider>
  );
}

export default Supercheck;
